INSERT INTO `wp_posts` VALUES (1,1,'2015-05-05 18:30:38','2015-05-05 18:30:38','Welcome to WordPress. This is your first post. Edit or delete it, then start blogging!','Hello world!','','publish','open','open','','hello-world','','','2015-05-12 22:47:29','2015-05-12 22:47:29','',0,'http://prosupport.monsoondev.com/?p=1',0,'post','',1),(2,1,'2015-05-05 18:30:38','2015-05-05 18:30:38','This is an example page. It\'s different from a blog post because it will stay in one place and will show up in your site navigation (in most themes). Most people start with an About page that introduces them to potential site visitors. It might say something like this:\n\n<blockquote>Hi there! I\'m a bike messenger by day, aspiring actor by night, and this is my blog. I live in Los Angeles, have a great dog named Jack, and I like pi&#241;a coladas. (And gettin\' caught in the rain.)</blockquote>\n\n...or something like this:\n\n<blockquote>The XYZ Doohickey Company was founded in 1971, and has been providing quality doohickeys to the public ever since. Located in Gotham City, XYZ employs over 2,000 people and does all kinds of awesome things for the Gotham community.</blockquote>\n\nAs a new WordPress user, you should go to <a href=\"http://prosupport.monsoondev.com/wp-admin/\">your dashboard</a> to delete this page and create new pages for your content. Have fun!','Sample Page','','trash','open','open','','sample-page','','','2015-05-06 18:34:14','2015-05-06 18:34:14','',0,'http://prosupport.monsoondev.com/?page_id=2',0,'page','',0),(5,1,'2015-05-05 20:30:14','2015-05-05 20:30:14','<div class=\"row\">\r\n  <div class=\"col-md-4\">\r\n    <h2>Implementation</h2>\r\n    <p>Our Implementation process serves as your transition from purchasing the software to becoming a productive seller</p>\r\n    <p><a class=\"btn btn-default\" href=\"http://prosupport.monsoondev.com/hello-world/\" role=\"button\">View details &raquo;</a></p>\r\n  </div>\r\n  <div class=\"col-md-4\">\r\n    <h2>Technical Support</h2>\r\n    <p>We offer a variety of technical support services including free email support, extensive online documentation, best practice sharing and billable phone support.</p>\r\n    <p><a class=\"btn btn-default\" href=\"http://prosupport.monsoondev.com/menu-sub-child/\" role=\"button\">View details &raquo;</a></p>\r\n  </div>\r\n  <div class=\"col-md-4\">\r\n    <h2>Professional Services</h2>\r\n    <p>Our Professional Services Team is made up of expert developers with deep product and industry knowledge, process management.</p>\r\n    <p><a class=\"btn btn-default\" href=\"http://prosupport.monsoondev.com/projects/wireless-boggling/\" role=\"button\">View details &raquo;</a></p>\r\n  </div>\r\n</div>','Our Services','','publish','open','closed','','our-services','','','2015-05-14 15:59:09','2015-05-14 15:59:09','',0,'http://prosupport.monsoondev.com/?page_id=5',0,'page','',0),(6,1,'2015-05-05 20:30:14','2015-05-05 20:30:14','&lt;!-- Main hero unit for a primary marketing message or call to action --&gt;\r\n&lt;div class=\"hero-unit\"&gt;\r\n&lt;h1&gt;Hello, world!&lt;/h1&gt;\r\n&lt;p&gt;This is a template for a simple marketing or informational website. It includes a large callout called the hero unit and three supporting pieces of content. Use it as a starting point to create something more unique.&lt;/p&gt;\r\n&lt;p&gt;&lt;a class=\"btn btn-primary btn-large\"&gt;Learn more &amp;raquo;&lt;/a&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n\r\n&lt;!-- Example row of columns --&gt;\r\n&lt;div class=\"row\"&gt;\r\n&lt;div class=\"span4\"&gt;\r\n&lt;h2&gt;Heading&lt;/h2&gt;\r\n&lt;p&gt;Donec id elit non mi porta gravida at eget metus. Fusce dapibus, tellus ac cursus commodo, tortor mauris condimentum nibh, ut fermentum massa justo sit amet risus. Etiam porta sem malesuada magna mollis euismod. Donec sed odio dui. &lt;/p&gt;\r\n&lt;p&gt;&lt;a class=\"btn\" href=\"#\"&gt;View details &amp;raquo;&lt;/a&gt;&lt;/p&gt;\r\n&lt;/div&gt;\r\n&lt;div class=\"span4\"&gt;\r\n&lt;