.monsooncommerce.com/infoexchange/\"><img class=\"aligncenter wp-image-8518 size-thumbnail\" src=\"https://prosupport.monsooncommerce.com/wp-content/uploads/2015/03/Support-Center-Icons-r05a-07-08-150x150.png\" alt=\"\" width=\"150\" height=\"150\" /></a>\r\n    </div>\r\n    <div class=\"col-md-8\">\r\n       {last-4-posts}\r\n    </div>\r\n</div>','Home-minimal','','inherit','open','open','','29-revision-v1','','','2015-05-15 21:36:40','2015-05-15 21:36:40','',29,'http://prosupport.monsoondev.com/29-revision-v1/',0,'revision','',0),(66,1,'2015-05-15 21:51:14','2015-05-15 21:51:14','<strong>Update: February 6, 2015</strong>\r\n\r\nWe have completed our investigation, and have performed testing of the integration between Stone Edge (v7.025 and v7.5.0.0) and ShipRush 10.3. We are happy to report there are no problems with the integration.\r\n\r\nWe urge you to follow the ShipRush upgrade instructions carefully, and to perform a backup prior to the installation.\r\n\r\nThank you,\r\nMonsoon Commerce Support\r\n\r\n<!--more-->\r\n\r\n<strong>Original post: February 5, 2015</strong>\r\n\r\nOur Support team has received a number of reports from Monsoon Stone Edge customers who have installed the ShipRush 10.3 upgrade and experienced an issue with the integration.\r\n\r\nWe’re currently performing end-to-end testing to replicate the issues and identify the problem.\r\n\r\nAt this time, we recommend that all Stone Edge customers hold off on upgrading to ShipRush 10.3. We will update this post as more information becomes available.','[Resolved] Stone Edge customers advised to delay upgrade to ShipRush 10.3','','publish','open','open','','resolved-stone-edge-customers-advised-to-delay-upgrade-to-shiprush-10-3','','','2015-05-15 21:51:14','2015-05-15 21:51:14','',0,'http://prosupport.monsoondev.com/?p=66',0,'post','',0),(67,1,'2015-05-15 21:51:14','2015-05-15 21:51:14','<strong>Update: February 6, 2015</strong>\r\n\r\nWe have completed our investigation, and have performed testing of the integration between Stone Edge (v7.025 and v7.5.0.0) and ShipRush 10.3. We are happy to report there are no problems with the integration.\r\n\r\nWe urge you to follow the ShipRush upgrade instructions carefully, and to perform a backup prior to the installation.\r\n\r\nThank you,\r\nMonsoon Commerce Support\r\n\r\n<!--more-->\r\n\r\n<strong>Original post: February 5, 2015</strong>\r\n\r\nOur Support team has received a number of reports from Monsoon Stone Edge customers who have installed the ShipRush 10.3 upgrade and experienced an issue with the integration.\r\n\r\nWe’re currently performing end-to-end testing to replicate the issues and identify the problem.\r\n\r\nAt this time, we recommend that all Stone Edge customers hold off on upgrading to ShipRush 10.3. We will update this post as more information becomes available.','[Resolved] Stone Edge customers advised to delay upgrade to ShipRush 10.3','','inherit','open','open','','66-revision-v1','','','2015-05-15 21:51:14','2015-05-15 21:51:14','',66,'http://prosupport.monsoondev.com/66-revision-v1/',0,'revision','',0),(68,1,'2015-05-15 21:54:59','2015-05-15 21:54:59','Our Stone Edge offices have lost phone service, and Comcast estimates it will not be restored until late Thursday night or Friday morning.\r\n\r\nThe best way to get in touch with  Stone Edge Support in the interim is to <a title=\"go to Stone Edge technical support request form\" href=\"http://www.stoneedge.com/main/about-us/contact/contact-support/\" target=\"_blank\">open up a ticket on the website</a>. We\'ll continue to post updates as additional information becomes available.','Stone Edge Support: Phone outage','','publish','open','open','','stone-edge-support-phone-outage','','','2015-05-15 21:54:59','2015-05-15 21:54:59','',0,'http://prosupport.monsoondev.com/?p=68',0,'post','',0),(69,1,'2015-05-15 21:54:59','2015-05-15 21:54:59','Our Stone Edge offices have lost phone service, and Comcast estimates it will not be restored until late Thursday night or Friday morning.\r\n\r\nThe best way to get in touch with  Stone Edge Support in the interim is to <a title=\"go to Stone Edge technical support request form\" href=\"http://www.stoneedge.com/main/about-us/contact/contact-support/\" target=\"_blank\">open up a ticket on the website</a>. We\'ll continue to post updates as additional information becomes available.','Stone Edge Support: Phone outage','','inherit','open','open','','68-revision-v1','','','2015-05-15 21:54:59','2015-05-15 21:54:59','',68,'http://prosupport.monsoondev.com/68-revision-v1/',0,'revision','',0),(70,1,'2015-05-15 21:56:00','2015-05-15 21:56:00','Due to severe weather, there will be some delays in response times for Stone Edge support.\r\n\r\nThank you,\r\n<a title=\"go to the Support Center\" href=\"https://support.monsooncommerce.com/\" target=\"_blank\">Monsoon Commerce Support</a>','Stone Edge Support: Delays due to severe weather','','publish','open','open','','stone-edge-support-delays-due-to-severe-weather','','','2015-05-15 21:56:00','2015-05-15 21:56:00','',0,'http://prosupport.monsoondev.com/?p=70',0,'post','',0),(71,1,'2015-05-15 21:56:00','2015-05-15 21:56:00','Due to severe weather, there will be some delays in response times for Stone Edge support.\r\n\r\nThank you,\r\n<a title=\"go to the Support Center\" href=\"https://support.monsooncommerce.com/\" target=\"_blank\">Monsoon Commerce Support</a>','Stone Edge Support: Delays due to severe weather','','inherit','open','open','','70-revision-v1','','','2015-05-15 21:56:00','2015-05-15 21:56:00','',70,'http://prosupport.monsoondev.com/70-revision-v1/',0,'revision','',0),(72,1,'2015-05-15 21:58:09','2015-05-15 21:58:09','<a href=\"http://www.smartcardalliance.org/slideshows-20120409/?template=slides\" target=\"_blank\">EMV&reg; Chip and PIN technology</a> will have liability consequences for sellers during <strong>card-present</strong> transactions.\r\n\r\nA transaction is card-present when the card and the cardholder are in the same physical location as the merchant and the card is swiped through a terminal.\r\n<!--more-->\r\n<h2>What this means for you</h2>\r\n\r\n<strong>For card-present transactions after October 1, 2015</strong>:\r\n<ul>\r\n	<li>If you accept payment using an EMV® Chip and PIN terminal, the liability for fraudulent card transactions in your physical store will not change.</li>\r\n	<li>If you accept payment using a Magnetic Stripe terminal, the liability for fraudulent card transactions in your physical store will fall to you.</li>\r\n</ul>\r\n<h2>What you need to know</h2>\r\n<ul>\r\n	<li>If you are using a Magnetic Stripe Reader terminal for card-present transactions, you will need to replace it with an EMV® Chip and PIN terminal if you want the liability for fraudulent card transactions to continue to follow current Visa/MasterCard/AmEx policies.</li>\r\n</ul>\r\n<div class=\"content-box-gray\">If you use <strong>Monsoon Stone Edge</strong> with an EMV® Chip and PIN terminal, there will be a change to your <a href=\"http://www.stoneedge.com/kb/mergedProjects/general/What_are_EMVs_and_how_can_I_use_one_with_Stone_Edge_.htm\" target=\"_blank\">workflow</a>.</div>\r\n<ul>\r\n	<li>If you continue to use a Magnetic Stripe Reader terminal for card-present transactions after October 1, 2015, the liability for fraudulent card transactions will shift to you.</li>\r\n</ul>\r\nFor more information, see <a href=\"http://www.stoneedge.com/kb/mergedProjects/general/What_are_EMVs_and_how_can_I_use_one_with_Stone_Edge_.htm\" target=\"_blank\">What are EMVs® and how can I use one with Stone Edge?</a>\r\n\r\n[polldaddy type=\"iframe\" survey=\"CED98B4AB897F078\" height=\"auto\" domain=\"infoexchange\" id=\"emv-chip-pin-ix-post-survey\"]','Liability shift for card transactions coming October 1, 2015','','publish','open','open','','liability-shift-for-card-transactions-coming-october-1-2015','','','2015-05-18 16:04:23','2015-05-18 16:04:23','',0,'http://prosupport.monsoondev.com/?p=72',0,'post','',0),(73,1,'2015-05-15 21:58:09','2015-05-15 21:58:09','<a href=\"http://www.smartcardalliance.org/slideshows-20120409/?template=slides\" target=\"_blank\">EMV&reg; Chip and PIN technology</a> will have liability consequences for sellers during <strong>card-present</strong> transactions.\r\n\r\nA transaction is card-present when the card and the cardholder are in the same physical location as the merchant and the card is swiped through a terminal.\r\n<!--more-->\r\n<h2>What this means for you</h2>\r\n\r\n<strong>For card-present transactions after October 1, 2015</strong>:\r\n<ul>\r\n	<li>If you accept payment using an EMV® Chip and PIN terminal, the liability for fraudulent card transactions in your physical store will not change.</li>\r\n	<li>If you accept payment using a Magnetic Stripe terminal, the liability for fraudulent card transactions in your physical store will fall to you.</li>\r\n</ul>\r\n<h2>What you need to know</h2>\r\n<ul>\r\n	<li>If you are using a Magnetic Stripe Reader terminal for card-present transactions, you will need to replace it with an EMV® Chip and PIN terminal if you want the liability for fraudulent card transactions to continue to follow current Visa/MasterCard/AmEx policies.</li>\r\n</ul>\r\n<div class=\"content-box-gray\">If you use <strong>Monsoon Stone Edge</strong> with an EMV® Chip and PIN terminal, there will be a change to your <a href=\"http://www.stoneedge.com/kb/mergedProjects/general/What_are_EMVs_and_how_can_I_use_one_with_Stone_Edge_.htm\" target=\"_blank\">workflow</a>.</div>\r\n<ul>\r\n	<li>If you continue to use a Magnetic Stripe Reader terminal for card-present transactions after October 1, 2015, the liability for fraudulent card transactions will shift to you.</li>\r\n</ul>\r\nFor more information, see <a href=\"http://www.stoneedge.com/kb/mergedProjects/general/What_are_EMVs_and_how_can_I_use_one_with_Stone_Edge_.htm\" target=\"_blank\">What are EMVs® and how can I use one with Stone E